description:
Thorgal is a critically acclaimed Belgian comic book series by the Belgian writer Jean Van Hamme and the Polish graphic artist Grzegorz Rosinski. The comic unites many themes and legends into one consistent world, ranging from Norse mythology and Atlantean fantasy to science fiction, and including such genres as dark drama, horror and adventure stories.

The tale takes place in the seventh century and draws its narrative power from the imaginary world of magic spells and legends, where men and gods still mix. More than a simple adventure story, this series is a true apology for freedom and the fight against the arbitrary, because what stands out most in ThorgalÃ¢â‚¬â„¢s personality is his deep sense of humanity... 
